import * as Form from '@radix-ui/react-form';
import './GoalsContainer.scss';
import { DateTime } from 'luxon';

const GoalsContainer = () => {
  return (
    <div className="goals-container">
      <div className="h-full flex flex-col justify-center items-center">
        <div className="text-center">
          <div className="text-8xl mb-5">{DateTime.now().toLocaleString(DateTime.TIME_SIMPLE)}</div>
          <div>Good evening, Commander</div>
        </div>
        <div>
          <div>What is your main focus for today?</div>
          <Form.Root>
            <Form.Field name="whats ur goal">
              <Form.Label>goal</Form.Label>
              <Form.Control />
              <Form.Message className="FormMessage" match="valueMissing">
                Please enter your email
              </Form.Message>
            </Form.Field>
          </Form.Root>
        </div>
      </div>
    </div>
  );
};

export default GoalsContainer;
